import React from 'react'
import { Link } from 'react-router-dom';

function Nav() {
    return (
        <div className='nav'>


            <Link to="/" className="App-link">
                Home
            </Link>

            <Link to="/page2" className="App-link">
                Crypto
            </Link>
        </div>
    )
}

export default Nav
